import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import "./index.css";

class App extends Component {
  render() {
    return (
      <div className="jumbotron jumbotron-fluid">
        <div className="container">
          <h1 className="display-4">Markable Music</h1>
          <p className="lead">Make it sound remarkable</p>
        </div>
        <div className="bg">cfgdfgfg</div>
        <div id="menu">
          <p>Keys or Drums</p>
          <p>Pick a Key</p>
          <p>BPM</p>
          <p>0:00</p>
          <button>Record</button>
          <button>Play Button</button>
          <button>Stop</button>
          <p>Metronome</p>
          <button>Save</button>
          <button>Logout</button>
        </div>
      </div>
    );
  }
}

export default App;
